import { component as buttonComponent } from "~/data/ui_frameworks/material_ui/components/Button";
import {EComponentGroupTitle, EComponentTitle, TComponentGroup} from "~/interfaces/material_components";

const {INPUTS} = EComponentGroupTitle;
const {CHECKBOX, DATE_TIME, RADIO, SELECT, SLIDER, SWITCH, TEXT_FIELD, TRANSFER_LIST} = EComponentTitle;

const componentGroup: TComponentGroup = {
  iconType: "user",
  title: "Inputs",
  components: [
    buttonComponent,
    { title: "Checkbox", props: [] },
    { title: "Date / Time", props: [] },
    { title: "Radio", props: [] },
    { title: "Select", props: [] },
    { title: "Slider", props: [] },
    { title: "Switch", props: [] },
    { title: "Text Field", props: [] },
    { title: "Transfer List", props: [] }
  ]
};

export default componentGroup;
